// Importando estilos


window.onload = function () {
    var input = document.getElementById("tf_2do");
    var btn = document.querySelector("form button");
    var tabela = document.getElementById("table");
    // var listaDeTarefas: Tarefa[] = [];
    function exibirTarefas(tarefa) {
        // Cria elementos da tabela
        var tr = document.createElement("tr");
        var tdCheck = document.createElement("td");
        var check = document.createElement("input");
        check.setAttribute("type", "checkbox");
        var tdConteudo = document.createElement("td");
        var tdApagar = document.createElement("td");
        var tdPrioridade = document.createElement("td");
        tabela.appendChild(tr);
        tr.appendChild(tdCheck);
        tdCheck.appendChild(check);
        check.addEventListener('click', function () {
            if (!tarefa.checked) {
                tarefa.checked = true;
                tr.className = 'done';
            }
            else {
                tarefa.checked = false;
                tr.className = 'none';
            }
        });
        tr.appendChild(tdConteudo);
        tdConteudo.innerHTML = "" + tarefa.conteudo;
        // Adicionar prioridade
        tr.appendChild(tdPrioridade);
        if (tarefa.prioridade == 1) {
            tdPrioridade.innerHTML = "[baixa]";
        }
        else if (tarefa.prioridade == 2) {
            tdPrioridade.innerHTML = "[m\u00E9dia]";
        }
        else {
            tdPrioridade.innerHTML = "[alta]";
        }
        tr.appendChild(tdApagar);
        tdApagar.innerHTML = "<i class=\"material-icons\">delete</i>";
        tdApagar.addEventListener('click', function () {
            tr.remove();
        });
    }
    btn.addEventListener("click", function (e) {
        e.preventDefault();
        var content = input.value;
        // Extrai prioridade 
        var regex = /#[1-3]\s/;
        var prioridadeRegex = content.match(regex);
        var p = 1;
        if (prioridadeRegex) {
            p = Number(prioridadeRegex[0][1]);
            content = content.replace(regex, '');
        }
        var tarefaInput = {
            checked: false,
            prioridade: p,
            conteudo: content
        };
        // listaDeTarefas.push(tarefaInput);
        exibirTarefas(tarefaInput);
    });
};


